import { Container } from 'react-bootstrap';

const AutoLayout = () => {
  return (
    <Container className="mt-5">
      <h1>Welcome to My Portfolio</h1>
      <p>Feel free to explore my projects and get in touch with me.</p>
    </Container>
  );
};

export default AutoLayout;
